import React from "react";

const Contact = () => {
  return (
    <section id="contact" className="py-16 bg-gray-100">
      <div className="container mx-auto px-6">
        <h3 className="text-3xl font-bold text-center mb-6">Contact Us</h3>
        <form className="max-w-xl mx-auto space-y-4">
          <input type="text" placeholder="Name" className="w-full p-3 border rounded" />
          <input type="email" placeholder="Email" className="w-full p-3 border rounded" />
          <textarea placeholder="Message" className="w-full p-3 border rounded h-32" />
          <button type="submit" className="bg-blue-600 text-white px-6 py-3 rounded">Send Message</button>
        </form>
      </div>
    </section>
  );
};

export default Contact;
